      SUBROUTINE eomccsdtq_x4_1(d_a,k_a_offset,d_b,k_b_offset,d_c,k_c_of
     &fset)
C     i0 ( p5 p6 p7 p8 h1 h2 h3 h4 )_xv + = -1 * P( 24 ) * Sum ( h13 ) * x ( p5 p6 p7 h1 h2 h13 )_x * i1 ( h13 p8 h3 h4 )_v
      IMPLICIT NONE
