     &_mb(k_sym+h13b-1)))))) .eq. irrep_x) THEN
      CALL TCE_RESTRICTED_6(p5b,p6b,p7b,h1b,h2b,h13b,p5b_1,p6b_1,p7b_1,h
     &1b_1,h2b_1,h13b_1)
      CALL TCE_RESTRICTED_4(p8b,h13b,h3b,h4b,p8b_2,h13b_2,h3b_2,h4b_2)
      dim_common = int_mb(k_range+h13b-1)
      dima_sort = int_mb(k_range+p5b-1) * int_mb(k_range+p6b-1) * int_mb
