     &IT('eomccsdtq_x4_1_5_1',1,MA_ERR)
      IF ((h1b .le. p9b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(p9b_1
     & - 1 + (noab+nvab) * (h1b_1 - 1 + (noab+nvab) * (h13b_1 - 1 + (noa
     &b+nvab) * (h10b_1 - 1)))))
