     &,int_mb(k_range+h1b-1),int_mb(k_range+h13b-1),int_mb(k_range+h10b-
     &1),4,3,2,1,1.0d0,.false.)
      CALL ADD_HASH_BLOCK(d_c,dbl_mb(k_c),dimc,dbl_mb(k_c_offset),(p9b -
     & noab - 1 + nvab * (h1b - 1 + noab * (h13b - 1 + noab * (h10b - 1)
